import React, { Component } from 'react';
import {connect} from "react-redux";
import Receipt from "./Receipt.js"



class ReceiptPage extends Component {
    constructor(props){
        super(props);
    }


    render() {
        const { customers, items, orders } = this.props;

        return(
            <div>
                {orders != null ? (orders.forEach((order) => {
                    <Receipt />
                })) : (<div/>)}
            </div>
        );
    }
}

function mapStateToProps({ customers, items, orders }, props){
    return {
        customers,
        items,
        orders,
        ...props
    }
}

export default connect(mapStateToProps)(ReceiptPage);
